import { AuthProvider } from '../contexts/auth'

interface Return extends JSX.Element {
  displayName?: string
}
const withAuth = (Component: React.ElementType): Return => {
  return (props: Record<string, unknown>) => (
    <AuthProvider>
      <Component {...props} />
    </AuthProvider>
  )
}

export { withAuth }
